  static async urlToBlob(url) {
    return (await fetch(url)).blob();
  }

  static getHeader(nom, prenom) {
    return new Paragraph({
      children: [
        new TextRun({
          text: nom + " " + prenom,
          bold: true,
          alignment: AlignmentType.CENTER,
        }),
      ],
      floating: {
        horizontalPosition: {
          align: HorizontalPositionAlign.CENTER,
        },
        verticalPosition: {
          align: VerticalPositionAlign.TOP,
        },
      },
    });
  }
